The definition of the subscription root object is slightly different from other root objects. Its Resolve function always returns a Stream, and the field parameters are usually used as data filtering conditions. The following example subscribes to an integer stream, which generates one integer per second. The parameter step specifies the integer step size with a default of 1 use async_graphql::*; struct Subscription; #[Subscription]
impl Subscription { async fn integers(&self, #[arg(default = "1")] step: i32) -> impl Stream<Item = i32> { let mut value = 0; tokio::time::interval(Duration::from_secs(1)).map(move |_| { value += step; value }) }
}

